import "./ImageCarousel.css";

function imageCarousel(props) {
	return (
		<div className="ImageCarousel">
			{props.images.map((info, index) => {
				return <div key={index}>{info}</div>;
			})}
		</div>
	);
}

export default imageCarousel;
